        public static string GetFriendlyName(PROPERTYKEY key)
        {
            var dkey = new Tuple<Guid, uint>(key.fmtid, key.pid);
            if (pKeys.ContainsKey(dkey))
                return pKeys[dkey];

            return null;
        }

        public static PROPERTYKEY? GetPropertyKey(string name)
        {
            if (pKeysInverse.ContainsKey(name))
            {
                var tuple = pKeysInverse[name];
                PROPERTYKEY key;
                key.fmtid = tuple.Item1;
                key.pid = tuple.Item2;

                return key;
            }

            return null;
        }

